export const InputInf = createContext();

export const InputInfProvider = (props) => {
  const [isLogin, setIsLogin] = React.useState(false);

  return (
    <InputInf.Provider value={{ isLogin, setIsLogin }}>
      {props.children}
    </InputInf.Provider>
  );
};
